                        //left: "77px",
                        //top: "144.81px"
                    }}  
                >
                </img>

                <img
                    src={img102}
                    alt="ballet dancer"
                    className="thumbnail" 
                    style={{
                        //left: "157.75px",
                        //top: "175.54px"
