                    }}  
                >
                </img>


                <img
                    src={img105}
                    alt="person playing piano with a mic"
                    className="thumbnail" 
                    style={{
                        //left: "319.85px",
                        //top: "96px"
                    }}  
                >
                </img>

                <img
                    src={img106}
                    alt="person swimming"
                    className="thumbnail"
                    style={{
                        //left: "319.85px",
                        //top: "201.45px"
                    }}  
                >
                </img>

                <img
                    src={img107}
                    alt="person meditating"
                    className="thumbnail"
                    style={{
